console.log("search js file loaded")
document.addEventListener("turbolinks:load", function(){
	$input = $("[data-behaviour = 'autocomplete']")

	var options = {
		 getValue: "title",
		 url: '/autocomplete',
		 list: {
				match: {
					enabled: true
				}
			}

	}

	$input.easyAutocomplete(options)
});
